import React, { useRef, useEffect } from 'react';
import { View, Text, TextInput, Pressable, StyleSheet, Animated, Easing, useWindowDimensions } from 'react-native';

const useBreathingAnimation = (duration = 4000) => {
  const anim = useRef(new Animated.Value(0)).current;

  useEffect(() => {
    const animation = Animated.loop(
      Animated.sequence([
        Animated.timing(anim, {
          toValue: 1,
          duration,
          easing: Easing.linear,
          useNativeDriver: false,
        }),
        Animated.timing(anim, {
          toValue: 0,
          duration,
          easing: Easing.linear,
          useNativeDriver: false,
        })
      ])
    );

    animation.start();
    return () => animation.stop();
  }, [duration]);

  return anim;
};

const Terminal = () => {
  const { width } = useWindowDimensions();
  const breatheAnim = useBreathingAnimation(4000);

  const terminalScale = breatheAnim.interpolate({
    inputRange: [0, 1],
    outputRange: [1, 1],
  });

  // Get dynamic styles based on screen width
  const dynamicStyles = {
    terminalWindow: {
      marginBottom: width <= 768 ? 20 : 30,
    },
    terminalBody: {
      padding: width <= 480 ? 15 : 20,
      minHeight: width <= 480 ? 250 : 300,
    },
    terminalLine: {
      fontSize: width <= 480 ? 12 : 14,
      lineHeight: width <= 480 ? 18 : 20,
    },
    commandOptions: {
      flexDirection: width <= 480 ? 'column' : 'row',
    }
  };

  return (
    <Animated.View style={[
      styles.terminalWindow,
      dynamicStyles.terminalWindow,
      {
        transform: [{ scale: terminalScale }]
      }
    ]}>
      <View style={styles.terminalHeader}>
        <Text style={styles.terminalTitle}>Your Personal Assistant</Text>
        <View style={styles.terminalControls}>
          <View style={[styles.terminalDot, { backgroundColor: '#FF605C' }]} />
          <View style={[styles.terminalDot, { backgroundColor: '#FFBD44' }]} />
          <View style={[styles.terminalDot, { backgroundColor: '#00CA4E' }]} />
        </View>
      </View>

      <View style={[styles.terminalBody, dynamicStyles.terminalBody]}>
        <View style={styles.terminalLines}>
          <Text style={[styles.terminalLine, dynamicStyles.terminalLine]}>
            <Text style={styles.terminalPrompt}>{"> "}</Text>
            <Text>Initializing EVE protocol...</Text>
          </Text>
          <Text style={[styles.terminalLine, dynamicStyles.terminalLine]}>
            <Text style={styles.terminalPrompt}>{"> "}</Text>
            <Text>Connecting to your Telegram...</Text>
          </Text>
          <Text style={[styles.terminalLine, dynamicStyles.terminalLine]}>
            <Text style={styles.terminalPrompt}>{"> "}</Text>
            <Text>Loading AI personalization modules...</Text>
          </Text>
          <Text style={[styles.terminalLine, dynamicStyles.terminalLine]}>
            <Text style={styles.terminalPrompt}>{"> "}</Text>
            <Text>I have become your digital twin.</Text>
          </Text>
          <Text style={[styles.terminalLine, dynamicStyles.terminalLine]}>
            <Text style={styles.terminalPrompt}>{"> "}</Text>
            <Text style={styles.terminalHighlight}>Ready for interaction.</Text>
          </Text>
        </View>

        <View style={[styles.commandOptions, dynamicStyles.commandOptions]}>
          <Pressable style={styles.commandButton}>
            <Text style={styles.commandButtonText}>
              <Text style={styles.commandPrefix}>{"> "}</Text>
              Who is Eve?
            </Text>
          </Pressable>
          <Pressable style={styles.commandButton}>
            <Text style={styles.commandButtonText}>
              <Text style={styles.commandPrefix}>{"> "}</Text>
              What can Eve do?
            </Text>
          </Pressable>
          <Pressable style={styles.commandButton}>
            <Text style={styles.commandButtonText}>
              <Text style={styles.commandPrefix}>{"> "}</Text>
              How can I gain access to Eve?
            </Text>
          </Pressable>
        </View>

        <View style={styles.terminalInputLine}>
          <Text style={styles.terminalPrompt}>{">_ "}</Text>
          <TextInput
            style={styles.terminalInput}
            placeholder="Enter command..."
            placeholderTextColor="rgba(244, 228, 9, 0.3)"
            inputMode="text"
            readOnly={false}
            rows={1}
            aria-label="Terminal input"
          />
        </View>
      </View>
    </Animated.View>
  );
};

const styles = StyleSheet.create({
  terminalWindow: {
    width: '100%',
    maxWidth: 800,
    backgroundColor: '#000000',
    borderRadius: 10,
    border: '1px solid #F4E409',
    overflow: 'hidden',
    display: 'flex',
    flexDirection: 'column',
    position: 'relative',
    isolation: 'isolate',
    backfaceVisibility: 'hidden',
    transform: 'translate3d(0,0,0)',
    boxShadow: '0 0 30px rgba(0, 0, 0, 0.8)',
    marginBottom: 30,
    zIndex: 9999,
    position: 'relative',
  },
  terminalHeader: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: 15,
    backgroundColor: '#1A1A1A',
    borderBottomWidth: 1,
    borderBottomColor: '#F4E409',
  },
  terminalTitle: {
    color: '#F4E409',
    fontFamily: 'Orbitron_400Regular',
    fontSize: 14,
  },
  terminalControls: {
    flexDirection: 'row',
    gap: 8,
  },
  terminalDot: {
    width: 12,
    height: 12,
    borderRadius: 6,
  },
  terminalBody: {
    padding: 20,
    minHeight: 300,
    backgroundColor: '#000000',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
  },
  terminalLines: {
    marginBottom: 20,
    flex: 1,
  },
  terminalLine: {
    color: '#F4E409',
    fontFamily: 'monospace',
    fontSize: 14,
    marginBottom: 10,
    lineHeight: 20,
  },
  terminalPrompt: {
    color: '#F4E409',
    fontFamily: 'monospace',
    fontSize: 14,
    marginRight: 8,
  },
  terminalHighlight: {
    color: '#fff',
    textShadow: '0 0 10px rgba(255, 255, 255, 0.5)',
  },
  terminalInputLine: {
    flexDirection: 'row',
    alignItems: 'center',
    borderTopWidth: 1,
    borderTopColor: 'rgba(244, 228, 9, 0.1)',
    paddingTop: 15,
    marginTop: 'auto',
  },
  terminalInput: {
    flex: 1,
    backgroundColor: 'transparent',
    color: '#F4E409',
    fontFamily: 'monospace',
    fontSize: 14,
    height: 20,
    padding: 0,
    marginLeft: 10,
    outlineWidth: 0,
    borderWidth: 0,
    caretColor: '#F4E409',
  },
  commandOptions: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    gap: 10,
    marginBottom: 20,
    paddingTop: 10,
    borderTopWidth: 1,
    borderTopColor: 'rgba(244, 228, 9, 0.1)',
  },
  commandButton: {
    backgroundColor: '#0A0A0A',
    borderWidth: 1,
    borderColor: 'rgba(244, 228, 9, 0.2)',
    borderRadius: 4,
    padding: 8,
    paddingHorizontal: 12,
  },
  commandButtonText: {
    color: '#F4E409',
    fontFamily: 'monospace',
    fontSize: 13,
    opacity: 0.8,
  },
  commandPrefix: {
    color: '#666',
    marginRight: 4,
  },
});

export default Terminal;
